import React, { useState } from "react";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars, faGlobeEurope } from "@fortawesome/free-solid-svg-icons";
import Dropdown from "./Dropdown";
import {} from './header.style'

const Header = () => {
  const notifications = [
    {
      avatar: "https://placehold.it/30x30",
      fullName: "Nume Prenume",
      content: "1 notificare",
      read: false,
    },
    {
      avatar: "https://placehold.it/30x30",
      fullName: "Nume Prenume",
      content: "2 notificare",
      read: false,
    },
    {
      avatar: "https://placehold.it/30x30",
      fullName: "Nume Prenume",
      content: "3 notificare",
      read: false,
    },
  ];

  return (
    <div className="header">
      <div
        className="container"
        style={{ display: "flex", justifyContent: "space-between", maxWidth: "800px", margin: "auto"}}>
        <div className="logo">
          <Link to="/">
            <img src="" alt="" />
          </Link>
        </div>
        <div className="menu-toggle">
          <FontAwesomeIcon icon={faBars} />
        </div>
        <ul className="nav">
          <Dropdown icon={faGlobeEurope} elements={notifications} />
        </ul>
      </div>
    </div>
  );
};

export default Header;
